import React from 'react';
import {Container, Logo, Float} from './style.js';
import globe from '../../assets/globe.svg'
import floatBackground from '../../assets/floatBackground.svg'

function LandingPage() {
  return (
    <Container>
      <Logo>
        <img src={globe} alt=""/>
      </Logo>
      <Float>
        <div>
          <img src={floatBackground} className="bg"/>
          <div className="title">
            Face
            <span>Recognition</span>
          </div>
        </div>
      </Float>
    </Container>
  );
}

export default LandingPage;
